import pptxgen from "pptxgenjs";


export class ERBCreator{
    create(analysts, RankTitle) {
        //Cover Page
        let pres = new pptxgen();
        var img = new Image();
        img.src = "http://yourimage.jpg";
        let slide = pres.addSlide();
        slide.addImage({ data: "image/png;base64,", x: '0', y: '0', w: '100%', h: '70%' });
        slide.addText("Name of Presenter: " + this.analystsToString(analysts), { x: '0', y: '4.5' });
        slide.addText(RankTitle, { x: '0', y: '5' });
        slide.addText("Cyber Experimentation & Analysis Division", { x: '0', y: '5.5' });
        //Page2
        slide = pres.addSlide();
        slide.addImage({ data: "image/png;base64,", x: '0', y: '0', w: '100%' });
        slide.addText("Systems assessed during the CVPA are as follows: ", { x: '1', y: '2'});

        slide = pres.addSlide();
        slide.addImage({ data: "image/png;base64,", x: '0.2', y: '0.2', w: '90%',h:'90%' });

        //pres.writeFile("ERB.pptx");
        return pres.writeFile("ERB.pptx");
    }
    analystsToString(analysts) {
    let str = ""

    for (var i = 0, len = analysts.length; i < len; i++) {
        str += analysts[i].name + " ";
    }
    return str
    }
    
}